svg.script:
iterations = 2; // change it to control how many times it animates

var start = 0;
var finish = 2334;
var pace = 6.483;
var dist = 194.5;
var frame = 360;
var frames = 719;
var itr = 0;

function $(sel) { return document.querySelector(sel); }

function setAttributes(el, attrs) {
  for(var key in attrs) {
    el.setAttribute(key, attrs[key]);
  }
}

$("#trg").addEventListener("click", function( event ) {
  if(itr == iterations) {
      itr = 0;
      move();
  }
}, false);

var obg_pos = function(name, x, y, angle, norotate) {
  if (norotate) {
    setAttributes(name, {"x": x + 17.2, "y": y - 7});
  } else {
    setAttributes(name, {"x": x, "y": y, "transform": "rotate(" + angle + " " + (x + 42.1) + " " + (y + 23.9) + ")"});
  }
}

var obj_attr = function(el_pos, dif) {
  if (el_pos < 1) {
    l_x = -1000;
    l_y = -1000;
    l_a = 0;
  }
  if (el_pos > 1 && el_pos < 318) {
    l_x = 7.9 + (pace*frame - dif);
    l_y = 239.1;
    l_a = 0;
  }

  if (el_pos > 318 && el_pos < 759) {
    l_x = 325.9;
    l_y = 239.1 + (pace*frame - dif - 318);
    l_a = 90;
  }

  if (el_pos > 759 && el_pos < 997) {
    l_x = 325.9 + (pace*frame - dif - 759);
    l_y = 680.1;
    l_a = 0;
  }

  if (el_pos > 997 && el_pos < 1321) {
    l_x = 563.9;
    l_y = 680.1 - (pace*frame - dif - 997);
    l_a = -90;
  }

  if (el_pos > 1321 && el_pos < 1429) {
    l_x = 563.9 + (pace*frame - dif - 1321);
    l_y = 356.1;
    l_a = 0;
  }

  if (el_pos > 1429 && el_pos < 1672) {
    l_x = 671.9;
    l_y = 356.1 + (pace*frame - dif - 1429);
    l_a = 90;
  }

  if (el_pos > 1672 && el_pos < 1803) {
    l_x = 671.9 + (pace*frame - dif - 1672);
    l_y = 599.1;
    l_a = 0;
  }

  if (el_pos > 1803 && el_pos < 1962) {
    l_x = 802.9;
    l_y = 599.1 - (pace*frame - dif - 1803);
    l_a = -90;
  }

  if (el_pos > 1962 && el_pos < 2110) {
    l_x = 802.9 + (pace*frame - dif - 1962);
    l_y = 440.1;
    l_a = 0;
  }

  if (el_pos > 2110 && el_pos < finish) {
    l_x = 950.9;
    l_y = 440.1 + (pace*frame - dif - 2110);
    l_a = 90;
  }

  if (el_pos > finish) {
    l_x = -1000;
    l_y = -1000;
    l_a = 0;
  }

  return [l_x, l_y, l_a];
}

function move() {

  var l_pos = frame * pace;

  var a1_param = obj_attr(l_pos, 0);
  var a2_param = obj_attr(l_pos - dist, dist);
  var a3_param = obj_attr(l_pos - 2*dist, 2*dist);
  var a4_param = obj_attr(l_pos - 3*dist, 3*dist);
  var a5_param = obj_attr(l_pos - 4*dist, 4*dist);
  var a6_param = obj_attr(l_pos - 5*dist, 5*dist);
  var a7_param = obj_attr(l_pos - 6*dist, 6*dist);
  var a8_param = obj_attr(l_pos - 7*dist, 7*dist);
  var a9_param = obj_attr(l_pos - 8*dist, 8*dist);
  var a10_param = obj_attr(l_pos - 9*dist, 9*dist);
  var a11_param = obj_attr(l_pos - 10*dist, 10*dist);
  var a12_param = obj_attr(l_pos - 11*dist, 11*dist);

  var a13_param = obj_attr(l_pos - 12*dist, 12*dist);
  var a14_param = obj_attr(l_pos - 13*dist, 13*dist);
  var a15_param = obj_attr(l_pos - 14*dist, 14*dist);
  var a16_param = obj_attr(l_pos - 15*dist, 15*dist);
  var a17_param = obj_attr(l_pos - 16*dist, 16*dist);
  var a18_param = obj_attr(l_pos - 17*dist, 17*dist);
  var a19_param = obj_attr(l_pos - 18*dist, 18*dist);
  var a20_param = obj_attr(l_pos - 19*dist, 19*dist);
  var a21_param = obj_attr(l_pos - 20*dist, 20*dist);
  var a22_param = obj_attr(l_pos - 21*dist, 21*dist);
  var a23_param = obj_attr(l_pos - 22*dist, 22*dist);
  var a24_param = obj_attr(l_pos - 23*dist, 23*dist);

  obg_pos($("#a1"), a1_param[0], a1_param[1], a1_param[2], false);
  obg_pos($("#a2"), a2_param[0], a2_param[1], a2_param[2], true);
  obg_pos($("#a3"), a3_param[0], a3_param[1], a3_param[2], false);
  obg_pos($("#a4"), a4_param[0], a4_param[1], a4_param[2], false);
  obg_pos($("#a5"), a5_param[0], a5_param[1], a5_param[2], false);
  obg_pos($("#a6"), a6_param[0], a6_param[1], a6_param[2], true);
  obg_pos($("#a7"), a7_param[0], a7_param[1], a7_param[2], false);
  obg_pos($("#a8"), a8_param[0], a8_param[1], a8_param[2], false);
  obg_pos($("#a9"), a9_param[0], a9_param[1], a9_param[2], false);
  obg_pos($("#a10"), a10_param[0], a10_param[1], a10_param[2], false);
  obg_pos($("#a11"), a11_param[0], a11_param[1], a11_param[2], true);
  obg_pos($("#a12"), a12_param[0], a12_param[1], a12_param[2], false);

  obg_pos($("#a13"), a13_param[0], a13_param[1], a13_param[2], false);
  obg_pos($("#a14"), a14_param[0], a14_param[1], a14_param[2], true);
  obg_pos($("#a15"), a15_param[0], a15_param[1], a15_param[2], false);
  obg_pos($("#a16"), a16_param[0], a16_param[1], a16_param[2], false);
  obg_pos($("#a17"), a17_param[0], a17_param[1], a17_param[2], false);
  obg_pos($("#a18"), a18_param[0], a18_param[1], a18_param[2], true);
  obg_pos($("#a19"), a19_param[0], a19_param[1], a19_param[2], false);
  obg_pos($("#a20"), a20_param[0], a20_param[1], a20_param[2], false);
  obg_pos($("#a21"), a21_param[0], a21_param[1], a21_param[2], false);
  obg_pos($("#a22"), a22_param[0], a22_param[1], a22_param[2], false);
  obg_pos($("#a23"), a23_param[0], a23_param[1], a23_param[2], true);
  obg_pos($("#a24"), a24_param[0], a24_param[1], a24_param[2], false);

  $("#line").setAttribute("stroke-dashoffset", -1*l_pos);

  if (frame < frames) {
    frame++;
  } else {
    itr++;
    frame = 360;
  }

  if (itr < iterations) {
      setTimeout(function(){
        requestAnimationFrame(move);
      },  30);
  }
};

window.addEventListener('DOMContentLoaded', () => {
  move(); // call this function to start animation;
});
